getUniqueId = function () {
	var dateObject = new Date();
	var uniqueId = dateObject.getTime().toString().replace('14','');
	return uniqueId;
};

function goTo(line, t) {
	t = (t == undefined)  ? 100 : t;
	$('html, body').animate({
		scrollTop: $(line).offset().top-t
	}, 500);
}


/* Init on window resize 
-----------------------------------------------------------------------------*/
function initAfterResize(){
	window.ScreenWidth = $(window).width();
	window.ScreenHeight = $(window).height();
}

var resizeTimeout;
window.onresize = function(){
	clearTimeout(resizeTimeout);
	resizeTimeout = setTimeout(initAfterResize, 100);
};



/* Popups
-----------------------------------------------------------------------------*/
function popup_close(elm) {
	$("body").css("overflow", "auto");
	$(elm).fadeOut(100);
}
function popup_open(elm) {
	$("body").css("overflow", "hidden");
	$(elm).fadeIn(100, function(){
		if (elm == '#popup-howitwork') {
			popup_open_video(elm);
		}
	});
}
function popup_switch(elm1, elm2) {
	$(elm1).fadeOut(100, function(){
		$(elm2).fadeIn(100);
	});
}

function popup_open_video(elm) {
	let url = $(elm).data('url');
	
	if (!$(elm+' .popup-video-wrapper iframe').length) {
		$(elm+' .popup-video-wrapper').html(`<iframe 
			width="560" height="315" src="`+url+`" frameborder="0" 
			allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen>
		</iframe>`);
	}
}

function signin() {
	var form = 'form[name="form-signin"]';
	var form_data = $( form ).serialize()+'&key='+getUniqueId()+'&lng='+window.config['lang'];
	var loader = form + ' .loader';
		
		$(loader).fadeIn(100);
		
		$.post("?page_load=ajax&url=/ajax/signin.ajax", form_data ,function(data) { 
			data = JSON.parse(data); 
			  
			if (data['status'] == 1) {
				/*window.location.reload();*/
				window.location.href = '/'+window.config['lang']+'/account/';
			}
			else {
				alerx(data['title'], data['message']);
			}
		   
		}).done(function(){
			$(loader).fadeOut(500);
		});
}

