function account_save_settings(form_name) { 
	
	goTo('.fields-seperator', 100);
	
	var form = 'form[name="'+form_name+'"]';
	var form_data = $( form ).serialize()+'&key='+getUniqueId()+'&lng='+window.config['lang'];
	var loader = form + ' .loader';
		console.log($( form ).serialize());
		$(loader).fadeIn(100);
		
		$.post("?page_load=ajax&url=/ajax/account-edit.ajax", form_data ,function(data) {
			data = JSON.parse(data); 
			  
			if (data['status'] == 1) {
				alerx(data['title'], data['message']);
				$("#xrequisites").find("input").each(function(){
					if($.trim($(this).val()) != "")
						$(this).attr("readonly","true");
				});
			}
			else {
				alerx(data['title'], data['message'], 'error');
			}
		   
		}).done(function(){
			$(loader).fadeOut(500);
		});
}

