function account_choose_withdrawal(method, max_amount, purse) {

	$("#withdrawal-box").fadeIn(100);
	
	$('#withdrawal-method').val(method);
	$('#withdrawal-method').trigger("chosen:updated");
	$('#withdrawal-amount').val(max_amount);
	$('#withdrawal-purse').val(purse);
	
	if(purse.trim() && purse !== undefined)
		$('#withdrawal-purse').prop("readonly", true);
	
	goTo("#withdrawal-box", 200);
	
}

/* Go To functions */
function goto_account(section, query) {
	
	query = (query == undefined) ? '' : query;
	
	if (window.config['user_is_logged']) {
		window.location.href = '/'+window.config['lang']+'/account/'+section+'/'+query;
	}
	else {
		popup_open('#popup-signup');
	}
	
}


function alerx(ititle, icontent, type) {
	
	let width 	= ($(window).width() > 860) ? '640px' : '90%';
	
	if (type == 'error') {
		$.alert({
			boxWidth: width,
			useBootstrap: false,
			theme: 'material',
			title: ititle,
			content: icontent,
			closeIcon: true,
			draggable: true,
			
			buttons: {
				ok: {
					btnClass: 'btn-red',
					action: function(){}
				},
			}
		});
	}
	else {
		$.alert({
			boxWidth: width,
			useBootstrap: false,
			theme: 'material',
			title: ititle,
			content: icontent,
			btnClass: 'btn-blue',
			closeIcon: true,
			draggable: true,
		});
	}
}


function investment_calc(change_amount, first_run) {
	
	let data = {
		'tariff_id': 				$('#inp-tariff').val(),
		'tariff_name': 				$('#inp-tariff').find(':selected').data('name'),
		'tariff_days': 				$('#inp-tariff').find(':selected').data('days'),
		'tariff_type': 				$('#inp-tariff').find(':selected').data('type'),
		'tariff_min_usd': 			$('#inp-tariff').find(':selected').data('amountmin'),
		'tariff_max_usd': 			$('#inp-tariff').find(':selected').data('amountmax'),
		'tariff_percent_total': 	$('#inp-tariff').find(':selected').data('percenttotal'),
		'tariff_percent_daily': 	$('#inp-tariff').find(':selected').data('percentdaily'),
		'amount': 					parseFloat($('#inp-amount').val().replace(/[^\d.-]/g, '')),
		'method_id': 				parseFloat($('#inp-method').val()),
		'method_curr': 				$('#inp-method').find(':selected').data('currency'),
		'method_curr_l': 			$('#inp-method').find(':selected').data('currency').toLowerCase(),
		'method_name': 				$('#inp-method').find(':selected').data('name'),
	};
	
	data['tariff_min'] = data['tariff_min_usd']/window.config['rates'][data['method_curr']];
	data['tariff_max'] = data['tariff_max_usd']/window.config['rates'][data['method_curr']];
	
	data['tariff_min'] = investment_calc_pretify(data['tariff_min'])*1;
	data['tariff_max'] = investment_calc_pretify(data['tariff_max'])*1;
	data['tariff_min'] = (data['tariff_min'] < 0.001) ? 0.001 : data['tariff_min'];
	
	if ($('#inp-amount').val().indexOf(',') !== -1) {
		data['amount'] = $('#inp-amount').val().replace(',', '.');
		$('#inp-amount').val(data['amount']);
	}
	if ((isNaN(data['amount']) && !change_amount )|| first_run) {
		data['amount'] = data['tariff_min'];
		$('#inp-amount').val(data['amount']);
	}
	
	
	$('#display-min').text(data['tariff_min']+' '+data['method_curr']);
	$('#display-max').text(data['tariff_max']+' '+data['method_curr']);
	
	data['profit'] = data['amount']*data['tariff_percent_total']/100;
	data['profit'] = investment_calc_pretify(data['profit']);
	data['profit'] = isNaN(data['profit']) ? 0 : data['profit'];
	data['amount'] = isNaN(data['amount']) ? 0 : data['amount'];
	
	$('#display-percent-daily').text(data['tariff_percent_daily']);
	$('#display-percent-total').text(data['tariff_percent_total']);
	$('#display-days').text(data['tariff_days']);
	$('#display-amount').text(data['amount']);
	$('#display-profit').text(data['profit']);
	$('#display-curr-1').text(data['method_curr']);
	$('#display-curr-2').text(data['method_curr']);
	$('#display-tariff-name').text(data['tariff_name']);
	
	$('.display-type').fadeOut(0);
	$('#display-type-'+data['tariff_type']).fadeIn(0);
	
	
}

function investment_calc_pretify(number) {
	
	if (number < 1) {
		number = number.toFixed(6);
	}
	else if (number < 10) {
		number = number.toFixed(4);
	}
	else if (number < 100) {
		number = number.toFixed(2);
	}
	else {
		number = number.toFixed(0);
	}
	
	return number;
}


function deposit_now(form_name) {
	
	var form = 'form[name="'+form_name+'"]';
	var form_data = $( form ).serialize()+'&key='+getUniqueId()+'&lng='+window.config['lang'];
	var loader = form + ' .loader';
		
		$(loader).fadeIn(100); 
		
		$.post("?page_load=ajax&url=/ajax/account-deposit.ajax", form_data ,function(data) {  console.log(data);
			data = JSON.parse(data); 
			  
			if (data['status'] == 1) {
				$(form).html(`<div class="payment-form">
				<img src="/templates/frontend/default/images/payment-loader.svg" class="icon" alt="Waiting payment">
				<h5>`+data['title']+`</h5>
				<div class="desc">`+data['message']+`</div>
				`+data['form']+`
				</div>`);
			}
			else {
				alerx(data['title'], data['message']);
			}
		   
		}).done(function(){
			$(loader).fadeOut(500);
		});
}


function plan_cancel(plan_id) {
	
	//if(plan_id < 1) return;
	
	let width 	= ($(window).width() > 860) ? '640px' : '90%';
	let form_data = {plan_id: plan_id, key: getUniqueId(), lng: window.config['lang']};
	let ok_text, cancel_text, icontent;
	
	if(window.config['lang'] == 'ru'){
		ok_text = 'Да';
		cancel_text = 'Нет';
		icontent = '<strong>Вы действительно хотите отменить тариф?<strong>';
	}
	else {
		ok_text = 'Yes';
		cancel_text = 'Not';
		icontent = '<strong>Are you sure you want to cancel the tariff?<strong>';		
	}
	
	$.confirm({
		boxWidth: width,
		useBootstrap: false,
		theme: 'material',
		title: '',//ititle,
		content: icontent,
		closeIcon: true,
		draggable: true,
	    buttons: {
		    
			ok: {
				text: ok_text,
				btnClass: 'btn-red',
				action: function(){
					
					let box = $('.box-deposits').find('[data-id="'+ plan_id +'"]');
					
					box.append('<div class="loader"/>');
					box.find('.loader').fadeIn(100);
					
					$.post("?page_load=ajax&url=/ajax/plan-cancel.ajax", form_data ,function(data) { 
						data = JSON.parse(data); 
						  
						if (data['status'] == 0) {
							alerx('Error!', 'Error');
						}
						else {
							//alerx(data['title'], data['message']);
						}
					   
					}).done(function(){
							$(box).parent("div").fadeOut(500, function(){
								$(this).remove();
							});
					});
				
				}
			},
			cancel: {
				text: cancel_text,
				btnClass: 'btn-default',
				action: function(){ return; }
			}
	    }
	});
}

function pin_check(el) {
	const check = $(el);
	
	if(check.prop("checked") == true) return;
	
	let form_data = {key: getUniqueId(), lng: window.config['lang']};
	
	$.post("?page_load=ajax&url=/ajax/pin-check.ajax", form_data ,function(data) { 
		data = JSON.parse(data); 
		  
		if (data['status'] == 0) {
			alerx(data['title'], data['message'], 'error');
		}
		else {
			if(data['check'] == 1)
				alerx("", data['message']);
		}
	   
	}).done(function(){
		return;
	});
}

/* Init on window load
-----------------------------------------------------------------------------*/
window.onload = function(){
	
	window.ScreenWidth = $(window).width();
	window.ScreenHeight = $(window).height();
	
	
	
	$('.netmi-lang .netmi-current').click(function(){ 
		if ($('.netmi-lang').hasClass("netmi-opened")) {
			$('.netmi-lang').removeClass('netmi-opened');
		}
		else {
			$('.netmi-lang').addClass('netmi-opened');
		}
	});

	$('.netmi-navigation .netmi-current').click(function(){ 
		if ($('.netmi-navigation').hasClass("netmi-opened")) {
			$('.netmi-navigation').removeClass('netmi-opened');
		}
		else {
			$('.netmi-navigation').addClass('netmi-opened');
		}
	});
	
	
	/* Equal Heights */			
	if ($(".features-list").length > 0 && window.ScreenWidth > 1024) {
		$(".features-list .item .in").equalHeights();
	}
	
	
	if ($('.select').length > 0) {
		$('.select').chosen({width: "100%", disable_search: true});
	}
	
	
	/* Copy to clipboard */
	if ($('.copy').length > 0) {
		var clipboard = new ClipboardJS('.copy');
		
		clipboard.on('success', function(e) {
			alerx('Copied 👍','');
		});
	}
	
	
	/* Tooltips */
	$('[data-tooltip!=""]').qtip({ 
	   content: {
			attr: 'data-tooltip'
		},
		position: {
			target: 'mouse',
			adjust: {
				x: -30,
				y: 20
			}
		},
	})
	
	
	/* Main page: statistics */
	if ($('.netmi-features-stat').length > 0) {
		var csns = $.animateNumber.numberStepFactories.separator(',');
		$('#num-users').animateNumber({
			number: parseInt($('#num-users').data('number')),
			numberStep: csns
		}, 1000);
		$('#num-deposits').animateNumber({
			number: parseInt($('#num-deposits').data('number')),
			numberStep: csns
		}, 1500);
		$('#num-profits').animateNumber({
			number: parseInt($('#num-profits').data('number')),
			numberStep: csns
		}, 2500);
		$('#num-referral').animateNumber({
			number: parseInt($('#num-referral').data('number')),
			numberStep: csns
		}, 2000);
	}
	
	
	
	/* Account: statistics */
	if ($('.box-stats').length > 0) {
		var csns = $.animateNumber.numberStepFactories.separator(',');
		$('#num-account-withdrawal').animateNumber({
			number: parseInt($('#num-account-withdrawal').data('number')),
			numberStep: csns
		}, 1000);
		$('#num-account-deposit').animateNumber({
			number: parseInt($('#num-account-deposit').data('number')),
			numberStep: csns
		}, 1500);
		$('#num-account-people').animateNumber({
			number: parseInt($('#num-account-people').data('number')),
			numberStep: csns
		}, 2500);
		$('#num-account-profit').animateNumber({
			number: parseInt($('#num-account-profit').data('number')),
			numberStep: csns
		}, 2000);
	}
	
	
	/* FAQ Navigation */
	if ($('.netmi-faq-nav').length > 0) {
		$('.netmi-faq-nav a').click(function(){
			let section = $(this).attr('href').replace('#', '');
			
			$('.netmi-faq-nav a').removeClass('netmi-active');
			$('.netmi-faq-content .netmi-section').removeClass('netmi-active');
			
			$(this).addClass('netmi-active');
			$('.netmi-faq-content .netmi-section-'+section).addClass('netmi-active');
			
			return false;
			
		});
	}
	
	
	/* Account: New Deposit */
	if ($('.box-newdeposit').length > 0) {
		investment_calc(false, true);
	}
	
	
	/* Mobile Navigation */
	$('.netmi-nav-button').click(function(){
		let state = ($('.nav').hasClass('netmi-opened')) ? 1 : 0;
			
		if (state) {
			$('.netmi-nav').removeClass('netmi-opened');
		}
		else {
			$('.netmi-nav').addClass('netmi-opened');
		}
	});
	
	$('.netmi-nav .netmi-close').click(function(){
		$('.netmi-nav').removeClass('netmi-opened');
	});
	
	
	$('.netmi-row-nav-button').click(function(){
		let state = ($('.netmi-row-nav').hasClass('netmi-opened')) ? 1 : 0;
			
		if (state) {
			$('.netmi-row-nav').removeClass('netmi-opened');
		}
		else {
			$('.netmi-row-nav').addClass('netmi-opened');
		}
	});
		
};

